import { useEffect } from "react"
import { embedDashboard } from "@superset-ui/embedded-sdk"
import "./App.css"

function App() {
  const getToken = async () => {
    // const response = await fetch("/guest-token")
    // const token = await response.json()
    const token = {"token":"eyJ0eXAiOiJKV1QiLCJhbGciOiJIUzI1NiJ9..FzEWmFyA1FlVynTsQq9ayKJJCLh3TlJu1AMizQuXzj8"}
    return token
  }

  useEffect(() => {
    const embed = async () => {
      await embedDashboard({
        id: "78044529-a81e-4a36-a4b6-c12e0d1f4212", // given by the Superset embedding UI
        supersetDomain: "http://localhost:8088",
        mountPoint: document.getElementById("my-superset-container"), // html element in which iframe render
        fetchGuestToken: () => getToken(),
        dashboardUiConfig: {
          hideTitle: true,
          filters: {
              expanded: true,
          }
        },
      })
    }
    if (document.getElementById("dashboard")) {
      embed()
    }
  }, [])

  return (
    <div className="App">
      <h1>Superset Dashboard in React with NodeJS</h1>
      <div id="my-superset-container"/></div>
  )
}

export default App
